import React from "react";
import DataTable from "react-data-table-component";
import { useSelector } from "react-redux";

const columns = [
  {
    name: "ID",
    selector: "id",
    sortable: true,
  },
  {
    name: "Name",
    selector: "name",
    sortable: true,
  },
  {
    name: "Age",
    selector: "age",
    sortable: true,
  },
];

const ProductList = () => {
  const products = useSelector((state) => state.products);

  console.log(products);
  return (
    <div>
      <DataTable
        title="Product Data"
        columns={columns}
        data={products}
        pagination
      />
    </div>
  );
};

export default ProductList;
